“Still Human”, the debut film from director Oliver Chan Siu-kuen – an alumna from the Academy of Film – has been nominated in eight award categories at the 38th Hong Kong Film Awards, including Best Film, Best Director, Best Screenplay, Best Actor, Best Actress, Best Supporting Actor, Best New Performer and Best New Director. Congratulations!
